import React, { memo } from "react";

import { PlayerWrapper } from "./style";

export default memo(function LJPlayer() {
  return (
    <PlayerWrapper>
      <div className="content wrap-v2">
        <PlayerLeft>
          <HYPlayerInfo />
          <HYPlayerComment />
        </PlayerLeft>
        <PlayerRight>
          <HYPlayerSongs />
          <HYPlayerRelevant />
        </PlayerRight>
      </div>
    </PlayerWrapper>
  );
});
